Change-Id: I575ee701b2ad431c32f518b70baa738b864ceb63","distinct":true,"url":"https://api.github.com/repos/greedforgood/tensorflow/commits/6f92d219237a3b6a2fb3120e7609dea67dd6b8fd"},{"sha":"92152f1624501ba3c44cc2a71fb226c8004db259","author":{"name":"Yunxing Dai","email":"0e6edd405794f4fb8b1584e93c0a178f5c32bc6a@google.com"},"message":"Implement argument forwarding in value_inference

This cl allows us recursively peek outside of current control flow function and forward arguments inside into controlflow.  E.g.,:
```
 pred = .. dynamic value..

 op = 1
 if (pred) {
   if (pred) {
     return op
   } else {
     return op
   }
  } else {
    if (pred) {
      return op
    } else {
      return op
    }
  }
```

We are now able to tell the value of the nest conditional comes from the constant outside of the conditional.

